note.para:
Applications implementing the AES TLS Secure Transport Connection Profile will connect
      and interoperate with implementations of the BCP 195 TLS Profile;
      see .

listitem.para:
Application protocols typically provide a way for the server to offer TLS during an initial protocol exchange, and sometimes also provide a way for the server to advertise support for TLS (e.g., through a flag indicating that TLS is required);
                    unfortunately, these indications are sent before the communication channel is encrypted.
                    A client shall attempt to negotiate TLS even if these indications are not communicated by the server.
